Yale College sophomores returned to campus with help from a host of students, staff, and one very handy and Handsome Dan.

Welcome back, Class of #Yale2024! 

@handsomedanyale #yale

@YaleFootball is back! After 22 months away, the Bulldogs returned to the gridiron for a beautiful day at the Yale Bowl between two defending champions.

On Saturday, the Ivy League Champions hosted the 2021 opener against @PatriotLeague Champions Holy Cross. The Crusaders won 20-17 in a match that came down to the final minute. Bulldogs took the lead in the second quarter, scoring 2 touchdowns in 2 minutes. 
 
The Bulldogs are back at the Bowl this Saturday for their @IvyLeague opener vs. Cornell.

